vectorShader_frag:"#version 100\r\nprecision highp float;\r\nprecision mediump int;\r\n#define _OUTPUT_TYPE_\r\n\r\n#define TYPE_NONE 0\r\n#define TYPE_ID_ATTR 1\r\n#define TYPE_UNIFORM 4\r\n#define OUTPUT_INDEX 0\r\n#define OUTPUT_LAYER 1\r\n#define LAYER_NORMAL 1.0\r\n#define ALPHATEST_NEVER 1\r\n#define ALPHATEST_LESS 2\r\n#define ALPHATEST_EQUAL 3\r\n#define ALPHATEST_LESSEQUAL 4\r\n#define ALPHATEST_GREATER 5\r\n#define ALPHATEST_NOTEQUAL 6\r\n#define ALPHATEST_GREATEREQUAL 7\r\n\r\n\r\nuniform vec2 TextSize;\r\nuniform int HaveIconTexture;\r\nuniform float AlphaScale;\r\nuniform int IsNeedTextOffset;\r\n#ifdef OUTPUT_GENERAL\r\n    uniform sampler2D Sampler[2];\r\n    uniform int AlphaTest;\r\n    uniform int AlphaFunc;\r\n    uniform float AlphaRef;\r\n#endif\r\n\r\n#ifdef OUTPUT_SELECT\r\n    uniform int LayerSN;\r\n    uniform int SelectOutput;\r\n    uniform int SelectID;\r\n    uniform int SelectType;\r\n#endif\r\n\r\nvarying vec2 v_tp;\r\nvarying float v_textureIndex;\r\n\r\n#ifdef OUTPUT_GENERAL\r\n    void alphaTest(vec4 relColor){\r\n        if(AlphaTest==1) {\r\n            if(AlphaFunc == ALPHATEST_NEVER) discard;\r\n            else if(AlphaFunc == ALPHATEST_LESS) {\r\n                if(relColor.a>=AlphaRef) discard;\r\n            } else if(AlphaFunc == ALPHATEST_EQUAL) {\r\n                if(relColor.a!=AlphaRef) discard;\r\n            } else if(AlphaFunc == ALPHATEST_LESSEQUAL) {\r\n                if(relColor.a>AlphaRef) discard;\r\n            } else if(AlphaFunc == ALPHATEST_GREATER) {\r\n                if(relColor.a<=AlphaRef) discard;\r\n            } else if(AlphaFunc == ALPHATEST_NOTEQUAL) {\r\n                if(relColor.a==AlphaRef) discard;\r\n            } else if(AlphaFunc == ALPHATEST_GREATEREQUAL) {\r\n                if(relColor.a<AlphaRef) discard;\r\n            }\r\n        }\r\n    }\r\n#endif\r\n\r\n#ifdef OUTPUT_SELECT\r\n    vec4 intToVec4(int value){\r\n        vec4 ret = vec4(ivec4(value / 16777216,value/65536,value/256,value));\t\r\n        return mod(ret,256.0)/255.0;\r\n    }\r\n#endif\r\n\r\nvoid main(){\r\n    vec4 relColor = vec4(0.);        \r\n    #ifdef OUTPUT_GENERAL\r\n    \tif(v_textureIndex<0.5) {\r\n            if(HaveIconTexture==0) discard;\r\n            relColor = texture2D(Sampler[0],v_tp);\r\n        } else {            \r\n            if((TextSize.x==0.0)&& (TextSize.y==0.0)) discard;\r\n            relColor = texture2D(Sampler[1],v_tp);            \r\n        }\r\n        relColor.a*=AlphaScale;\r\n        alphaTest(relColor);\r\n    #endif\r\n\r\n    #ifdef OUTPUT_SELECT\r\n    \tfloat tempA;\r\n        relColor = vec4(1.0,1.0,1.0,1.0);\r\n\r\n        if(SelectOutput==OUTPUT_LAYER){\r\n            relColor = vec4(LAYER_NORMAL/255.0,intToVec4(LayerSN).yzw);\r\n        } else {\r\n            relColor=intToVec4(SelectID);\r\n            relColor.x=mod(relColor.x,128.0);\r\n            relColor.x=relColor.x+ float(SelectType)*128.0;\r\n        }\r\n        //icon\r\n        if(v_textureIndex<0.5) {\r\n            if(HaveIconTexture==0) discard;\r\n        } else {\r\n            if((TextSize.x==0.0)&& (TextSize.y==0.0)) discard;\r\n            \r\n        }\r\n    #endif\r\n    gl_FragColor = relColor;\r\n}",
vectorShader_vert:"#version 100\r\nprecision highp float;\r\nprecision mediump int;\r\n#define _OUTPUT_TYPE_\r\n\r\nattribute highp vec2 Input_p;\r\nattribute highp vec2 Input_tp;\r\nattribute float Input_id;\r\n\r\nuniform highp mat4 matWorldViewProj;\r\nuniform int ScreenWidth;//Screen Width\r\nuniform int ScreenHeight;//Screen Height\r\nuniform highp vec3 Coor;//\u5ea7\u6a19\r\nuniform int IconSize;//Icon \u5927\u5c0f\r\nuniform vec2 TextSize;//\u6587\u5b57\u65b9\u6846\u5927\u5c0f\r\nuniform float ZScale;\r\nuniform float LengthScale;\r\nuniform int HaveIconTexture;\r\nuniform int IsNeedTextOffset;\r\n\r\nvarying vec2 v_tp;\r\nvarying float v_textureIndex;\r\n\r\nvoid main(){\r\n    \tfloat width;\r\n\tfloat height;\r\n\tfloat offsetY;\r\n\t//icon\r\n\tif(Input_id<0.5)  {\r\n\t\twidth = float(IconSize)/float(ScreenWidth)*Input_p.x;\r\n\t\theight = float(IconSize)/float(ScreenHeight)*Input_p.y;\r\n\t\toffsetY = float(IconSize)/float(ScreenHeight);\r\n\r\n\t\t\r\n\t} else {\r\n\t\twidth = TextSize.x/float(ScreenWidth)*Input_p.x;\r\n\t\theight = TextSize.y/float(ScreenHeight)*Input_p.y;\r\n\t\tif(HaveIconTexture==1) {\r\n\t\t\tif(float(IsNeedTextOffset)>0.5) { \r\n\t\t\t\toffsetY = (2.0*float(IconSize)/float(ScreenHeight)+TextSize.y/float(ScreenHeight));\r\n\t\t\t} else offsetY=float(IconSize)/float(ScreenHeight);\r\n\t\t} else offsetY=TextSize.y/float(ScreenHeight);\r\n\t}\r\n\twidth*=LengthScale;\r\n\theight*=LengthScale;\r\n\tgl_Position=matWorldViewProj*vec4(Coor,1);\r\n\tgl_Position.z*=ZScale;\r\n\tfloat w = gl_Position.w;\r\n\tgl_Position/=gl_Position.w;\r\n\tgl_Position.x=width + gl_Position.x;\r\n\tgl_Position.y=height + gl_Position.y+ offsetY;\r\n\tgl_Position*=w;\r\n\tv_tp=Input_tp;\r\n\tv_textureIndex=Input_id;\r\n}",
viewshed_frag:"#version 100\r\n#ifdef GL_ES\r\nprecision highp float;\r\nprecision mediump int;\r\n#endif\r\n\r\n//Fragment Shader\r\nuniform mat4 DepthMapVP;\r\nuniform sampler2D DepthMap;\r\n\r\nuniform bool UseDepthMap;\r\nuniform vec3 DepthMapViewPos;\r\nuniform float DepthMapFar;\r\n\r\nuniform vec4 Color;\r\n\r\nvarying vec4 v_worldPos;\r\n\r\nbool convertDepthWorldPosToDepthMapScreen(out vec3 screen_p){\r\n\tvec4 temp_p = DepthMapVP*vec4(v_worldPos.xyz,1.0);\r\n\ttemp_p.xyz/=temp_p.w;\r\n\tif (temp_p.x>=-1.0 && temp_p.x<=1.0 && temp_p.y>=-1.0 && temp_p.y<=1.0 && temp_p.z>0.0 && temp_p.z<1.0)\r\n\t{\r\n\t\tscreen_p.xy=temp_p.xy;\r\n\t\tscreen_p.z=length(v_worldPos.xyz)/DepthMapFar;\r\n\t\tif(screen_p.z>1.0)\r\n\t\t\treturn false;\r\n\t\t\r\n\t\treturn true;\r\n\t}\r\n\treturn false;\r\n}\r\n\r\nvoid main()\r\n{\t\r\n\tvec3 depthmap_p;\r\n\tbool inDepthMap = convertDepthWorldPosToDepthMapScreen(depthmap_p);\r\n\tbool isOcclusion = false;\r\n\r\n\tvec2 tp;\r\n\tfloat xOffset = 1.0/1024.0;\r\n\tfloat yOffset = 1.0/1024.0;\r\n\ttp.x=(depthmap_p.x+1.0)/2.0;\r\n\ttp.y=(depthmap_p.y+1.0)/2.0;\r\n\r\n\tisOcclusion = isOcclusion || (depthmap_p.z<=texture2D(DepthMap,tp + vec2(0.0,0.0)).r+0.00005);\r\n\tisOcclusion = isOcclusion || (depthmap_p.z<=texture2D(DepthMap,tp + vec2(0.0,yOffset)).r+0.00005);\t\r\n\tisOcclusion = isOcclusion || (depthmap_p.z<=texture2D(DepthMap,tp + vec2(xOffset,0.0)).r+0.00005);\r\n\tisOcclusion = isOcclusion || (depthmap_p.z<=texture2D(DepthMap,tp + vec2(xOffset,yOffset)).r+0.00005);\r\n\r\n\t//isOcclusion = isOcclusion || (depthmap_p.z<=texture2D(DepthMap,tp + vec2(0.0,-yOffset)).r+0.00001);\r\n\t//isOcclusion = isOcclusion || (depthmap_p.z<=texture2D(DepthMap,tp + vec2(xOffset,-yOffset)).r+0.00001);\r\n\t//isOcclusion = isOcclusion || (depthmap_p.z<=texture2D(DepthMap,tp + vec2(-xOffset,yOffset)).r+0.00001);\r\n\t//isOcclusion = isOcclusion || (depthmap_p.z<=texture2D(DepthMap,tp + vec2(-xOffset,0.0)).r+0.00001);\r\n\t//isOcclusion = isOcclusion || (depthmap_p.z<=texture2D(DepthMap,tp + vec2(-xOffset,-yOffset)).r+0.00001);\r\n\r\n\tif(UseDepthMap){\r\n\t\tif(!isOcclusion||!inDepthMap){\r\n\t\t\tdiscard;\r\n\t\t}\r\n\t\telse{\r\n\t\t\tgl_FragColor = Color;\r\n\t\t\tgl_FragColor.a *= 0.8;\t\t\t\t\r\n\t\t}\r\n\t}else{\r\n\t\tfloat z = min(length(v_worldPos.xyz) / DepthMapFar , 1.0);\r\n\t\tgl_FragColor = vec4(z,z,z,1.0);\r\n\t}\t\t\r\n}",
